import React from 'react'

function Navegation({change}) {
  const list=['Examenes','Pacientes','Registro']
  return (
    <div className='w-2/12 bg-gray-300 border-r-2  border-gray-500 my-2 border-opacity-20 max-h-60" sticky left-0'>
        <ol className='p-2  h-full '>
            {list.map((elemet,i)=>{
            return(
              <li onClick={change(i+1)} className='p-2 text-center text-xl text-gray-700 rounded-md bg-green-primary bg-opacity-80 mb-1 uppercase  hover:bg-opacity-40 cursor-pointer hover:text-white'>{elemet}</li>
            )})}
        </ol>
    </div>
  )
}

export default Navegation
